import { Component } from 'react';
import './Detail.css'
import Search from '../Search/Search';
import Gallery from '../Gallery/Gallery';
import PropTypes from "prop-types";
import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

class Detail extends Component {
    constructor(props) {
        super(props);
        this.removeSearchResults = this.removeSearchResults.bind(this);
    }  

    removeSearchResults() {
        console.log("detail");
        document.getElementById("SearchID").style.display = 'none';
        document.getElementById("SearchResultsID").style.display = 'none';
        document.getElementById("SearchInputID").value = "";
        document.getElementById("StatSelectID").selectedIndex = 0;
        document.getElementById('asc').checked = false;
        document.getElementById('desc').checked = false;
    }

    render() {
        this.removeSearchResults();
        console.log("detail");

        return (
            <Router>
                <div class="Detail" id = "DetailID">
                    {this.props.player.id}
                </div>
            </Router>
        );
    }
}

export default Detail;
